import React from 'react';
import './Samp.css';

function Samp() {
  return (
    <div className='sbg'>
      <div className='text-wrap'>
        <a>___________________________</a>
        <h1>Humanizing your insurance.</h1>
        <form className="nominee-form">
            <div className="form-group">
            <input type="text"
                  placeholder="Nominee Name"
                  value={nomineename}
                  onChange={(e) => setnomineename(e.target.value)}
                  required />
            </div>
            <div className="form-group">
            <input type="text"
                  placeholder="Nominee Name"
                  value={nomineename}
                  onChange={(e) => setnomineename(e.target.value)}
                  required />
            </div>
            <button type="submit" className="submit-button">Add Nominee</button>
          </form>
        <button className='view-plans-btn'>VIEW PLANS</button>
      </div>
      <div className='pic-it'>
        <img src='/mnt/data/image.png' alt='Family' />
      </div>
    </div>
  );
}

export default Samp;
